import React from 'react'
import ReactDOM from 'react-dom'
import './index.css';

const Hello = (props) => {
    return (
        <div>
        <p>Happy coding {props.name}, you are {props.age} years old!</p>
    </div>
)
}

const App = () => {
    const name = 'Olivier';
    const age = '28';

    return (
        <div>
        <h1>Greetings</h1>
        <Hello name={"Olivier"} age={age * 2 }/>
        </div>
)
}

ReactDOM.render(<App />, document.getElementById('root'))
